INSERT INTO jobs (title, description, sector_extracted, job_category, competence_cleaned, company_name, Region, contract_type, niveau_détudes_requis, niveau_expérience, posted_date, remote_work) VALUES ('Scrum Master','En tant que  Scrum Master , votre mission consiste à s’assurer que la méthodologie SCRUM est comprise et bien appliquée et à veiller à ce que les règles, pratiques, valeurs soient respectées au sein des équipes accompagnées.   Fonctions et responsabilités :   Vous aurez la responsabilité d’assurer les tâches principales suivantes :   Accompagner l’équipe sur la compréhension et la mise en œuvre de la méthodologie Scrum  Mettre en place et animer les cérémonies  Piloter la backlog des US  Mettre en place et calculer les indicateurs opérationnels Agile  Animer les rétrospectives.','Informatique','Gestion de Projet','AGILE, SCRUM','RED TIC','Rabat-Salé-Kénitra','Freelance','Bac+5 et plus','Expérience entre 5 ans et 10 ans',to_date('03.05.2024', 'DD/MM/YYYY'),'');
