INSERT INTO jobs (title, description, sector_extracted, job_category, competence_cleaned, company_name, Region, contract_type, niveau_détudes_requis, niveau_expérience, posted_date, remote_work) VALUES ('Office Manager - Casablanca','Nous sommes à la recherche d'' Office Manager.    Missions principales :     Achats de matériels et fournitures et gestion budgétaire de caisse   Préparer les BL, BC et règlements fournisseurs   Gestion des déplacements à l''étranger   Suivi de la couverture santé   Organisation des événements internes  Suivi des absences et congés payés','Informatique','Science & IA','COMPTABILITÉ, FINANCE, GESTION, GESTION, BUDGÉTAIRE','BEINTERIM','Casablanca-Mohammedia','CDD & Intérim','Bac+3 & Bac+4','Débutant < 2 ans & Expérience entre 2 ans et 5 ans',to_date('22.03.2025', 'DD/MM/YYYY'),'');
