INSERT INTO jobs (title, description, sector_extracted, job_category, competence_cleaned, company_name, Region, contract_type, niveau_détudes_requis, niveau_expérience, posted_date, remote_work) VALUES ('Consultant Fonctionnel Odoo  - Agadir','Caisse Manager  est une entreprise innovante spécialisée dans le développement et la commercialisation de logiciels de gestion de point de vente. Nous accompagnons nos clients dans l’optimisation de leurs processus grâce à des solutions ERP sur-mesure. Afin de soutenir notre croissance, nous recherchons un  Consultant Fonctionnel Odoo  passionné et dynamique.   Missions :    Analyser les besoins des clients et les accompagner dans la transformation de leurs processus métiers.  Configurer et personnaliser les modules Odoo selon les spécificités et les exigences des clients.  Former les utilisateurs sur les fonctionnalités d’Odoo et les meilleures pratiques d’utilisation.  Assurer un suivi post-...','Informatique','Science & IA','FORMATION, GESTION, MANAGEMENT, PROCESSUS, MÉTIERS','CAISSE MANAGER','Agadir','CDI','Bac+2, Bac+3, Bac+4 & Bac+5 et plus','Expérience entre 2 ans et 5 ans',to_date('03.06.2025', 'DD/MM/YYYY'),'');
