INSERT INTO jobs (title, description, sector_extracted, job_category, competence_cleaned, company_name, Region, contract_type, niveau_détudes_requis, niveau_expérience, posted_date, remote_work) VALUES ('Assistante Aide Comptable  - Casablanca','Société opérant dans le domaine des technologies et logiciels informatique sur Casablanca cherche une  Assistante Aide Comptable , sous la supervision du service comptable et administrative , vous serez en charge de :    Le suivi des comptes clients et fournisseurs    La saisie des pièces comptables (factures, règlements, relevés bancaires)    L’archivage et la gestion documentaire    L’assistance à la préparation des déclarations fiscales et sociales    Le soutien lors des clôtures mensuelles et annuelles    Diverses tâches administratives liées à la comptabilité','Informatique','Science & IA','COMPTABILITÉ, FINANCE, GESTION','LACAISSE.MA','Casablanca-Mohammedia','CDI, CDD & Stage','Bac+2, Bac+3, Bac+4 & Bac+5 et plus','Débutant < 2 ans et plus',to_date('29.05.2025', 'DD/MM/YYYY'),'');
